import React from "react";
import {
  MenuItem,
  FormControl,
  Select,
  Card,
  CardContent,
} from "@material-ui/core";

function Filter() {
  return (
    <div>
      <Select variant="outlined">
        <MenuItem>Worldwide</MenuItem>
      </Select>
    </div>
  );
}

export default Filter;
